import React from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import logo from '../image/logo-zoo-ecf.png';

const Navigation = () => {

    const navigate = useNavigate();

    const directionConnexion = () => {
        navigate("/connexion");
    }

    return (
        <div className="barre_navigation">
            <img src={logo} width="50" height="auto" atl="logo zoo ecf"
                onClick={directionConnexion}
            />
            <NavLink to={"/"}>
                Accueil
            </NavLink>
            <NavLink to={"/animaux"}>
                Animaux
            </NavLink>
            <NavLink to={"/habitats"}>
                Habitats
            </NavLink>
            <NavLink to={"/services"}>
                Services
            </NavLink>
            <NavLink to={"/contact"}>
                Contact
            </NavLink>
            <button onClick={directionConnexion}>Espace pro</button>
        </div>
    );
};

export default Navigation;
